import { ListMovieStyled, SingleMovie } from "./styles";

type TListMovies = {
  movies: Array<any>;
};

const ListMovie = ({ movies }: TListMovies) => {
  return (
    <ListMovieStyled>
      {movies.map((item, index) => (
        <SingleMovie
          initial={{ opacity: 1, y: 1000 }}
          animate={{ opacity: 1, y: 0 }}
          key={index}
          image={item}
        />
      ))}
    </ListMovieStyled>
  );
};

export default ListMovie;
